import React from "react";
import { Routes, Route, Link} from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Routes>
        <Route path="/" />
        <Route path="/store" />
        <Route path="/quests" />
        <Route path="/profile" />
      </Routes>
    </div>
  );
}

export default App;
